import {
  Box,
  Button,
  Card,
  Divider,
  Grid2,
  Modal,
  TextField,
} from "@mui/material";
import React from "react";
import { CartItem } from "./CartItem";
import { AddressCart } from "./AddressCart";
import AddLocationAltIcon from "@mui/icons-material/AddLocationAlt";
import { ErrorMessage, Field, Formik } from "formik";
import * as Yup from "yup";
const item = [1, 1];
const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  bgcolor: "background.paper",
  outline: "none",
  boxShadow: 24,
  p: 4,
};
const initialValues = {
  streetAdsress: "",
  state: "",
  pincode: "",
  city: "",
};
const validateSchema = Yup.object().shape({
  streetAddress: Yup.string().required("Street address is required"),
  state: Yup.string().required("State is required"),
  pincode: Yup.number()
    .required("Pincode is required")
    .typeError("Pincode must be a number"),
  city: Yup.string().required("City is required"),
});
export const Cart = () => {
  const handleSubmit = () => {};
  const [open, setOpen] = React.useState(false);

  const handleClose = () => setOpen(false);
  const HandleOpenAdress = () => {
    setOpen(true);
  };
  const CreatOrederSelectAdress = () => {
    console.log("order created");
  };
  return (
    <>
      <main className="lg: flex justify-between">
        <section className="lg:w-[30%] space-y-6 lg:min-h-screen pt-10">
          {item.map((item) => (
            <CartItem />
          ))}
          <Divider />
          <div>
            <div className="billDetails px-5 text-sm">
              <p className="font-extralight py-5">Bill Details</p>

              <div className="flex justify-between text-gray-400">
                <p>Item Total</p>
                <p>$60</p>
              </div>
              <div className="flex justify-between text-gray-400">
                <p>Delivary Fees</p>
                <p>$20</p>
              </div>
              <div className="flex justify-between text-gray-400">
                <p>Plateform Fee</p>
                <p>$5</p>
              </div>
              <div className="flex justify-between text-gray-400">
                <p>Gst And restaurnat Charge</p>
                <p>$30</p>
              </div>
              <Divider />
              <div className="flex justify-between text-gray-400 mt-3">
                <p>Total Pay</p>
                <p>$115</p>
              </div>
            </div>
          </div>
        </section>
        <Divider orientation="vertical" flexItem />
        <div className="lg: w-[70%] flex justify-center px-5 pb-10 lg:pb-0">
          <div>
            <h1 className="text-center font-semibold text-2xl py-10">
              Choose Delhiveri Address
            </h1>
            <div className=" flex gap-5 flex-wrap justify-center">
              {[1, 1, 1, 1, 1].map((item) => (
                <AddressCart
                  item={item}
                  showBuuton={true}
                  handelAddress={CreatOrederSelectAdress}
                />
              ))}
              <Card className="flex gap-5 w-64 p-5">
                <AddLocationAltIcon />
                <div className="space-y-3 text-gray-400">
                  <h1 className="font-semibold text-lg text-white">
                    Add New Address
                  </h1>

                  <Button
                    variant="outlined"
                    onClick={HandleOpenAdress}
                    fullWidth
                  >
                    Add
                  </Button>
                </div>
              </Card>
            </div>
          </div>
        </div>
      </main>

      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <Formik
            initialValues={initialValues}
            validationSchema={validateSchema}
            onSubmit={handleSubmit}
          >
            <Grid2 container spacing={2}>
              <Grid2 item xs={12}>
                <Field
                  as={TextField}
                  name="streetAddress"
                  label="streetAddress"
                  fullWidth
                  variant="outline"
                  error={!ErrorMessage("streetAddress")}
                  helperText={
                    <ErrorMessage>
                      {(msg) => <span className="text-red-600">{msg}</span>}
                    </ErrorMessage>
                  }
                />
              </Grid2>
            </Grid2>
          </Formik>
        </Box>
      </Modal>
    </>
  );
};
